import styled from 'styled-components';

const Background = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 100vh;
  flex-direction: column;
  background-color : #fa7070;
`;

const Container = (page) => {
  return (
    <Background>
        {page}
    </Background>
  )
}

export default Container
